The html! macro supports a limited subset of the html standard. Rust's macro parsing tools are somewhat limited, so all text between tags must be quoted . However, writing HTML by hand is a bit tedious - IDE tools for Rust don't support linting/autocomplete/syntax highlighting. We suggest using RSX - it's more natural for Rust programs and does integrate well with Rust IDE tools. let name = "jane";
let pending = false;
let count = 10; dioxus::ssr::render_lazy(html! { <div> <p> "Hello, {name}!" </p> <p> "Status: {pending}!" </p> <p> "Count {count}!" </p> </div>
});

