At the heart of Dioxus is the concept of an "element" - a container that can have children, properties, event handlers, and other important attributes. Dioxus only knows how to render the VNode datastructure - an Enum variant of an Element, Text, Components, Fragments, and Anchors. Because Dioxus is meant for the Web and uses WebView as a desktop and mobile renderer, almost all elements in Dioxus share properties with their HTML counterpart. When we declare our elements, we'll do so using HTML semantics: rsx!( div { "hello world" }
) As you would expect, this snippet would generate a simple hello-world div. In fact, we can render these nodes directly with the SSR crate: dioxus::ssr::render_lazy(rsx!( div { "hello world" }
)) And produce the corresponding html structure: <div>hello world</div> Our structure declared above is made of two variants of the VNode datastructure: A VElement with a tagname of div A VText with contents of "hello world"
